package Overloading;

class Constructer
{
	Constructer()	//No Arguments Constructor
	{
		System.out.println("No Arguments Constructer");
	}
	
	Constructer(int n)	//Parameterized Constructor
	{
		System.out.println("Parameterized Constructer");
	}
	

}

public class Constructer_ex2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Constructer ob = new Constructer();
		
	}

}
